"use strict";

function countGoodRectangles(rectangles) {
    let ans = 0;
    let mx = 0;
    for (let i = 0; i < rectangles.length; i++) {
        let l = rectangles[i][0];
        let w = rectangles[i][1];
        let t = Math.min(l, w);
        if (mx < t) {
            mx = t;
            ans = 1;
        } else if (mx === t) {
            ans += 1;
        }
    }
    return ans;
}
